import React from 'react'
import Todo from './Todo'
// import "./styles.css";
import SingleTodo from './SingleTodo';

interface Props {
    todos: Todo[]
    completedTodos: Todo[]
    setTodos: React.Dispatch<React.SetStateAction<Todo[]>>
    completeTodo: (id: string) => void
    cancelCompletion: (id: string) => void
    deleteTodo: (id: string, list: Todo[]) => void
    editTodo: (id: string) => void
}

const TodoList:React.FunctionComponent<Props> = ({todos, completedTodos, setTodos, completeTodo, cancelCompletion, deleteTodo, editTodo}: Props) => {
  return (
    <div className='todos'>
        {todos.map((todo:Todo) => {
            return(
                //<SingleTodo />
                <SingleTodo key={todo.id} todo={todo} />
            )
        })}
        {/* {complete} */}
    </div>
  )
}

export default TodoList
